import React, { useEffect, useState } from 'react'
import '../CSS/Work.css'
import Background from '../Assets/app-dev.jpg'
import axios from 'axios'
function WorkPage() {


    var [worklists, setWorklists] = useState([])
    function fetchData() {
        axios.get("http://localhost:5100/WorkList")
            .then(response => {

                setWorklists(response.data);
            })
            .catch(error => {
                console.log(error);

            })
    }

    useEffect(() => {
        fetchData();
    })

    return (

        <div className="work-page">

            {worklists.map((item) => <div>
                <div className="items" style={{ backgroundImage: "url(" + item.images[1] + ")" }}></div>
                <h1 style={{color:"white", margin:'0'}}>{item.title}</h1>
            </div>)}

        </div>


    )
}

export default WorkPage
